import Link from "next/link";

const SideBarNav = () => (
  <div style={style.container}>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/search">
      <a>Search</a>
    </Link>
  </div>
);

const style = {
  container: {
    padding: 10,
  },
};

export default SideBarNav;
